import React from 'react'
import "../CSS/Right_Side.css"
import Particles from 'react-particles-js';

function Right_Side() {
    return (

        <div className="right-side">
            <Particles
                params={{
                    "particles": {
                        "number": {
                            "value": 100
                        },
                        "size": {
                            "value": 2
                        }
                    },
                    "interactivity": {
                        "events": {
                            "onhover": {
                                "enable": true,
                                "mode": "repulse"
                            }
                        }
                    }
                }}

                height='100vh'
                width='60vw'
                
                
                
                />

            <div style={{ marginLeft: '50px', }}>
                <br></br>
                <h1 style={{ color: 'white', fontSize: '70px', }}>Hi,<br />I'm Afran,<br /> App & Web Developer.</h1>
                <h3 style={{ color: 'white', }}>Full Stack Developer | Content Creator | Entrepreneur</h3>

            </div>

        </div>
    )
}

export default Right_Side
